function Stock(props){
    const stock=props.stock
    return(
        <tr>
            <td>{stock.name}</td>
            <td>{stock.symbol}</td>
            <td>{'$ '+stock.current_price.toLocaleString('en-US')}</td>
            <td>{"$ "+stock.market_cap.toLocaleString('en-US')}</td>
        </tr>
    )
}
export default Stock
